import './styles.css';

import EdificioImg from 'assets/images/product.png';

const PatologiaCard = () => {
    return (
        <div>
            <div>
                <EdificioImg />
            </div>
            <div>
                <h6>
                    Tipo de patologia
                </h6>
                <p>
                    Descrição sumária
                </p>
            </div>
        </div>
    );
}

export default PatologiaCard;
